console.log(Sdata[0].name);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
  <App 
  FName={Sdata[0].name}
  LName={Sdata[0].lname}
  place={Sdata[0].place}
  />
 <App 
  LName={Sdata[1].lname}
  place={Sdata[1].place}
  FName={Sdata[1].name}
  />

<App 
  FName={Sdata[2].name}
  LName={Sdata[2].lname}
  place={Sdata[2].place}
  />

